import React from 'react';

type TodolistType = {
    title:string;
    task:Array<ArrayTodolistType>
}

type ArrayTodolistType = {
    id:string;
    title:string;
    isDone:boolean;
}




export const Todolist = (props:TodolistType) => {
    return (
        <div>
     <h3>{props.title}</h3>
            <li>
                {props.task.map((el)=>{
                    return (
                        <ul>
                            {el.title}
                        </ul>
                    )
                })}
            </li>
        </div>
    );
};
